Vue.component("loading-indicator", {
    template:
        '\x3cdiv class\x3d"loading-indicator" :class\x3d"indicatorStyle"\x3e\n                    \x3cdiv class\x3d"cir cir-1"\x3e\x3c/div\x3e\n                    \x3cdiv class\x3d"cir cir-2"\x3e\x3c/div\x3e\n                    \x3cdiv class\x3d"cir cir-3"\x3e\x3c/div\x3e\n                \x3c/div\x3e',
    props: { show: { type: Boolean, default: !1 }, color: { type: String, default: "blue" } },
    computed: {
        indicatorStyle: function () {
            var a = [];
            this.show && a.push("show");
            a.push(this.color);
            return a.join(" ");
        },
    },
});
